import { BookingSummary } from '@/components/Booking/BookingSummary'
import { RootLayout } from '@/components/Layout/Layout'
import { Button, FileInput, Grid, Loader, Paper, Text, rem } from '@mantine/core'
import axios from 'axios'
import { useEffect, useState } from 'react'
import { useSearchParams } from 'react-router-dom'

import { IconFileCheck, IconReceipt } from '@tabler/icons-react'
import { isEmpty } from 'lodash'

const mockup = {
  startBookingDate: '2024-05-08 14:00:00',
  endBookingDate: '2024-05-10 12:00:00',
  user: {
    id: null
  },
  room: {
    id: 1
  },
  roomAmount: 2,
  adult: 4,
  children: 0,
  name: 'name1',
  email: 'ttt@gmd.cok',
  mobile: '2342342341',
  days: 2,
  total: 2000,
  note: 'tteas',
  status: 'BOOKING',
  checkInDate: null,
  checkOutDate: null,
  id: 6,
  createdAt: '2024-06-07T17:19:44.825Z',
  updatedAt: '2024-06-07T17:19:44.825Z',
  payment: {
    status: false, //true false
    updatedAt: '2024-06-07T17:19:44.825Z',

    file: { //TODO: stucture patment มีการเก็บไฟล์สลิปรูปแบบ base64
      name: 'bookingname120240607NO6', //'bookingName+Date+BookingID'
      base64: `data:image/jpeg;base64,`
    }
  }
}

const bankDetail = [
  { label: 'ธนาคาร', value: 'SCB' },
  { label: 'สาขา', value: 'BNK' },
  { label: 'ชื่อบัญชี', value: 'MS XXXXX' },
  { label: 'เลขบัญชี', value: '123123123123' }
]
export default function PaymentPage() {
  const [searchParams] = useSearchParams()
  const [bookingData, setBookingData] = useState({})
  const [room, setRoom] = useState({})
  const [loading, setLoading] = useState<boolean>(true)
  const [slipImage, setSlipImage] = useState<File | null>(null)

  useEffect(() => {
    setLoading(true)
    prepareBookingData()
  }, [])

  const prepareBookingData = async () => {
    const bookingID = Number(searchParams.get('id'))
    const data = mockup
    if (bookingID) {
	//TODO: เปิด API filter by booking ID
      //   const res = await apiBooking.getById(bookingID)

      //   if (res.success) {
      //     setBookingData(res.data)
      //   }

      setBookingData(data)
      if (data?.payment?.status) {
        onChangeSlipImage(data?.payment?.file)
      }
      fetchRoomName(data?.room?.id)
    }
  }

  const fetchRoomName = async (id: number) => {
    try {
	//TODO: เปิด API ค้นหา ROOM  filter by room ID
      const res = await axios.get(`https://dev.zlalabs.com/api/v1/rooms/${id}`) //apiRoom.getRoomById(id)
      if (res.status === 200) {
        console.log('resssss', res)

        setRoom(res.data?.data)
        setLoading(false)
      }
    } catch (err) {
      setRoom({})
    }
  }

  const onChangeSlipImage = (file) => {
    setSlipImage(file)
  }

  const onSubmit = async () => {
    const formData = new FormData()
    formData.append(`bookingID`, bookingData.id)
    if (slipImage) {
      formData.append(`file`, slipImage, slipImage.name)
    }
    console.log('formData', formData)

    try {
	//TODO: เปิด API ค้นหา create Paymeny body form data
	// {
	// 	bookingID : 0,
	// 	file :
	// }

      const res = await axios.post(`http://localhost:8000`, formData, {
        headers: { 'content-type': 'multipart/form-data' }
      }) //apiRoom.getRoomById(id)
      if (res.status === 200) {
        console.log('resssss', res)
      }
    } catch (err) {
      console.log('errr', err)
    }
  }

  return (
    <RootLayout>
      <Paper p="md" className="mt-4">
        {loading ? (
          <div className="flex items-center justify-center">
            <Loader color="blue" />
          </div>
        ) : (
          <BookingSummary
            {...{ data: { ...bookingData }, room: room }}
            onSubmit={false}
            isPayment
            style={{ backgroundColor: '#F5F5F5' }}
          />
        )}{' '}
        <Grid className="mt-8" justify="center">
          {bookingData?.payment?.status ? (
            <>
              <Grid.Col span={{ lg: 6, sm: 6 }} className='flex items-center justify-center'>
                <Text fw={500} lh={4} >
                  ชำระเงินเรียบร้อย
                </Text>
				<IconFileCheck color='#30b26f'/>
              </Grid.Col>
              <Grid.Col span={12} className="flex justify-center">
                <img width={150} src={bookingData?.payment?.file?.base64} />
              </Grid.Col>
            </>
          ) : (
            <>
              <Grid.Col span={{ lg: 6, sm: 6 }} className="flex justify-center">
                <img src="/Payment/qrcode.png" width={300} height={300}></img>
              </Grid.Col>
              <Grid.Col span={{ lg: 6, sm: 6 }}>
                {bankDetail?.map((val) => (
                  <Text fw={400} lh={4} key={val.label}>
                    {val.label}: <span className=" font-bold">{val?.value}</span>
                  </Text>
                ))}
              </Grid.Col>

              <Grid.Col span={4} className="flex items-center">
                <Text fw={600}>แนบหลักฐานการชำระเงิน</Text>
              </Grid.Col>
              <Grid.Col span={6}>
                <FileInput
                  value={slipImage}
                  onChange={onChangeSlipImage}
                  leftSection={
                    <IconReceipt style={{ width: rem(18), height: rem(18) }} stroke={1.5} />
                  }
                  label=""
                  placeholder="อัปโหลดสลิป"
                  leftSectionPointerEvents="none"
                />
              </Grid.Col>
            </>
          )}
        </Grid>
        <div className="mt-4 flex items-center justify-center flex-col">
          <Button
            disabled={isEmpty(slipImage?.name) || bookingData?.payment?.status}
            size="lg"
            style={{ width: '80%' }}
            color="#C38370"
            onClick={onSubmit}
          >
            <span
              style={{
                color:
                  isEmpty(slipImage?.name) || bookingData?.payment?.status ? '#adb5bd' : '#F6EEE0'
              }}
            >
              ยืนยันการชำระเงิน
            </span>
          </Button>
        </div>
      </Paper>
    </RootLayout>
  )
}
